import React from "react";
import { useRouter } from "next/router";

const Category = () => {
  const router = useRouter();
  const { cat } = router.query;

  return (
    <div className="category">
      <h2>Category: {cat.toUpperCase()}</h2>
    </div>
  );
};

export default Category;
